integration_05:
node DataNode {
    has id: str;
    has value: str;
}

walker CrudWalker {
    has operation: str;
    has node_id: str;
    has data: str;

    can execute with entry {
        if operation == "create" {
            new_node = DataNode(id=node_id, value=data);
            here ++> new_node;
            report {"status": "created", "id": node_id};
        } elif operation == "read" {
            nodes = [here-->(`?DataNode:id==node_id)];
            if nodes {
                report {"status": "found", "value": nodes[0].value};
            } else {
                report {"status": "not found"};
            }
        } elif operation == "update" {
            nodes = [here-->(`?DataNode:id==node_id)];
            if nodes {
                nodes[0].value = data;
                report {"status": "updated"};
            }
        } elif operation == "delete" {
            nodes = [here-->(`?DataNode:id==node_id)];
            if nodes {
                del nodes[0];
                report {"status": "deleted"};
            }
        }
    }
}
